    change_position(num) {
      if (num == 0) {
        this.buttonHeight = -222;
      }
      if (num == 1) {
        this.buttonHeight = 107;
      }
    },
    upload_data() {
      this.dialogVisable = true;
    },
    push(num) {
      this.$router.push({
        name: "upload",
        query: {
          upload_status: num,
        },
      });
    },
    chaindetails(id) {
      this.$router.push({
        path: "/details/" + id,
      });
    },
  },
  components: {
    chainItem,
  },
  mounted() {
    getModelListAPI().then((res) => {
      if (res.data) {
        this.model_list = res.data.model_list.reverse();
      }
    });
  },
};
</script>

